#define PF0 (*((volatile uint32_t *)0x40025004))

// Interrupt service routine
// Executed every 12.5ns*(period)
volatile uint32_t i = 0;
void SysTick_Handler(void){
	GPIO_PORTF_DATA_R &= ~0x02;
	if(GPIO_PORTE_DATA_R == 0x03){
		SineValue = shoot[i];
		DAC_Out(SineValue);
		i = (i+1)%4080;
	}else if(GPIO_PORTE_DATA_R == 0x05){
		SineValue = invaderkilled[i];
		DAC_Out(SineValue);
		i = (i+1)%3377;
	}else if(GPIO_PORTE_DATA_R == 0x09){
		SineValue = explosion[i];
		DAC_Out(SineValue);
		i = (i+1)%2000;
	}else if(GPIO_PORTE_DATA_R == 0x06){
		SineValue = fastinvader1[i];
		DAC_Out(SineValue);
		i = (i+1)%982;
	}/*else if(GPIO_PORTE_DATA_R == 0x0A){
		SineValue = D[i];
		DAC_Out(SineValue);
		i = (i+1)%229791;
	}*/
	
	else{
		SineValue = SineWave[i];
		DAC_Out(SineValue);
		i = (i+1)%64;
	}
}



